import React, { useState, useEffect } from "react";
import { motion } from "framer-motion";
import { Bar } from "react-chartjs-2";
import {
  Chart as ChartJS,
  BarElement,
  CategoryScale,
  LinearScale,
  Tooltip,
  Legend,
} from "chart.js";
import {
  Sun,
  Moon,
  LogOut,
  LayoutDashboard,
  GraduationCap,
  CalendarDays,
  MessageSquare,
  Megaphone,
  BookOpen,
  Bell,
} from "lucide-react";

// 🏫 College logo import (put your logo in src/assets/)
import collegeLogo from "../assets/college-logo.png"; 

ChartJS.register(BarElement, CategoryScale, LinearScale, Tooltip, Legend);

interface Student {
  name: string;
  email: string;
  department: string;
  semester: string;
  rollNo: string;
  profileImage?: string;
}

const StudentDashboard: React.FC = () => {
  const [studentData, setStudentData] = useState<Student | null>(null);
  const [activeTab, setActiveTab] = useState("Dashboard");
  const [darkMode, setDarkMode] = useState(false);
  const [aiFeedback, setAiFeedback] = useState("");

  useEffect(() => {
    setStudentData({
      name: "Sadia Naz",
      email: "sadianaz123@gmail.com",
      department: "Information Technology",
      semester: "7th Semester",
      rollNo: "BSIT-2021-45",
      profileImage: "https://cdn-icons-png.flaticon.com/512/3135/3135715.png",
    });

    setAiFeedback(
      "Your performance is improving! Keep focusing on your coding skills and teamwork projects 💪"
    );
  }, []);

  const handleLogout = () => {
    alert("You have been logged out successfully!");
  };

  const modules = [
    { name: "Dashboard", icon: <LayoutDashboard size={18} /> },
    { name: "Results", icon: <GraduationCap size={18} /> },
    { name: "Attendance", icon: <CalendarDays size={18} /> },
    { name: "Messaging", icon: <MessageSquare size={18} /> },
    { name: "Events", icon: <Megaphone size={18} /> },
    { name: "Announcements", icon: <Bell size={18} /> },
    { name: "Library", icon: <BookOpen size={18} /> },
  ];

  return (
    <div
      className={`min-h-screen flex transition-all relative overflow-hidden ${
        darkMode ? "text-white" : "text-gray-900"
      }`}
      style={{
        backgroundImage: `url('${
          darkMode
            ? "https://images.unsplash.com/photo-1503264116251-35a269479413?auto=format&fit=crop&w=1600&q=80"
            : "https://images.unsplash.com/photo-1519389950473-47ba0277781c?auto=format&fit=crop&w=1600&q=80"
        }')`,
        backgroundSize: "cover",
        backgroundPosition: "center",
        backgroundAttachment: "fixed",
      }}
    >

      {/* 🔹 College Logo Watermark (center background) */}
      <motion.div
        className="absolute inset-0 flex items-center justify-center pointer-events-none"
        initial={{ opacity: 0 }}
        animate={{ opacity: darkMode ? 0.05 : 0.1 }}
        transition={{ duration: 1.5 }}
      >
        <motion.img
          src={collegeLogo}
          alt="College Logo"
          className="w-96 h-96 opacity-10 select-none"
          animate={{ scale: [1, 1.03, 1], rotate: [0, 2, -2, 0] }}
          transition={{ repeat: Infinity, duration: 10, ease: "easeInOut" }}
        />
      </motion.div>

      {/* Sidebar */}
      <motion.aside
        initial={{ x: -100, opacity: 0 }}
        animate={{ x: 0, opacity: 1 }}
        className="w-64 p-6 shadow-lg flex flex-col justify-between backdrop-blur-md bg-white/80 dark:bg-gray-800/80 rounded-r-2xl z-10"
      >
        <div>
          <h2 className="text-2xl font-bold text-center text-blue-600 mb-6">
            🎓 Student Dashboard
          </h2>

          {/* Profile */}
          <div
            className="flex flex-col items-center cursor-pointer mb-8"
            onClick={() => setActiveTab("Profile")}
          >
            <img
              src={studentData?.profileImage}
              alt="Profile"
              className="w-20 h-20 rounded-full border-4 border-blue-500 object-cover shadow-md"
            />
            <p className="mt-3 font-semibold">{studentData?.name}</p>
          </div>

          {/* Menu */}
          <nav className="space-y-2">
            {modules.map((item) => (
              <button
                key={item.name}
                onClick={() => setActiveTab(item.name)}
                className={`w-full flex items-center gap-3 px-4 py-2 rounded-lg font-medium relative transition-all duration-300 ${
                  activeTab === item.name
                    ? "bg-blue-100 text-blue-700 font-semibold"
                    : "hover:bg-gray-200 dark:hover:bg-gray-700 text-gray-700 dark:text-gray-300"
                }`}
              >
                {activeTab === item.name && (
                  <span className="absolute left-0 top-0 h-full w-1 bg-blue-600 rounded-r-md"></span>
                )}
                <span className="text-blue-500">{item.icon}</span>
                {item.name}
              </button>
            ))}
          </nav>
        </div>

        <button
          onClick={handleLogout}
          className="flex items-center justify-center gap-2 py-2 mt-6 rounded-lg bg-red-500 hover:bg-red-600 text-white font-semibold transition-all"
        >
          <LogOut size={18} /> Logout
        </button>
      </motion.aside>

      {/* Main */}
      <main className="flex-1 flex flex-col backdrop-blur-sm bg-white/60 dark:bg-black/40 rounded-l-2xl z-10">
        {/* Header */}
        <header className="bg-gradient-to-r from-blue-600 to-indigo-500 p-5 flex justify-between items-center shadow-md rounded-tl-2xl">
          <h1 className="text-xl md:text-2xl font-bold text-white">
            {activeTab === "Dashboard"
              ? `Welcome, ${studentData?.name} 👋`
              : activeTab}
          </h1>
          <button
            onClick={() => setDarkMode(!darkMode)}
            className="p-2 rounded-full bg-white/20 hover:bg-white/30 text-white"
          >
            {darkMode ? <Sun size={20} /> : <Moon size={20} />}
          </button>
        </header>

        {/* Dashboard content */}
        <div className="p-6 overflow-y-auto">
          {/* existing dashboard content here (same as before) */}
        </div>
      </main>
    </div>
  );
};

export default StudentDashboard;
